sources.components/btn-close/btn-close.scss:
/* btn-close start */
.btn-close {
    position: relative;
    border: none;
    cursor: pointer;
    background: none;
    padding: 0;
    width: 50px;
    height: 50px;
    display: inline-block;
    transition: transform 0.2s, opacity 0.2s;
}

.btn-close:hover {
    transform: scale(1.1);
}

.btn-close:active {
    transform: scale(0.9);
    opacity: 0.8;
}

.btn-close::before,
.btn-close::after {
    content: "";
    background: #d2d2d2;
    height: 40px;
    width: 3px;
    position: absolute;
    border: 10px;
    top: 50%;
}

.btn-close::before {
    transform: translateY(-50%) rotate(45deg);
}

.btn-close::after {
    transform: translateY(-50%) rotate(-45deg);
}
/* btn-close end */

