sources.components/models/models.scss:
.models {
  &__content {
    padding: 60px 0 70px;
  }
  &__list {
    display: flex;
    flex-wrap: wrap;
    margin-top: -30px;
    margin-left: -15px;
    margin-right: -15px;
    margin-bottom: 60px;
  }
  &__item {
    width: calc(100% / 4 - (120px / 4));
    margin-top: 30px;
    margin-left: 15px;
    margin-right: 15px;
    & > * {
      height: 100%;
    }
  }
  &__tech {
    width: 100%;
    &-title {
      margin-bottom: 30px;
      font-size: 26px;
    }
    &-scroll {
      display: none;
      margin-top: 25px;
    }
  }
}

@keyframes pseudoScroll {
  0% {
    opacity: 0;
    left: 30px;
  }
  50% {
    opacity: 1;
    left: 60px;
  }
  100% {
    opacity: 0;
    left: 90px;
  }
}

.pseudo-scroll {
  position: relative;
  padding: 0 25px;

  &__line,
  &__line-active {
    height: 4px;
    border-radius: 3px;
  }
  &__line {
    position: relative;
    background-color: #dde3eb;
    &-active {
      position: absolute;
      top: 0;
      left: 30px;
      width: 70px;
      background-color: $active;
      animation-name: pseudoScroll;
      animation-duration: 1.5s;
      animation-timing-function: ease-in-out;
      animation-iteration-count: infinite;
      animation-fill-mode: forwards;
    }
  }
  &__arrow {
    & svg {
      position: absolute;
      top: 50%;
      fill: #b2bdcc;
    }

    &.--prev svg {
      left: 0;
      transform: translateY(-50%) rotate(180deg);
    }
    &.--next svg {
      right: 0;
      transform: translateY(-50%);
    }
  }
}

@media (max-width: 1366px) {
	.models {
    &__item {
      width: calc(100% / 3 - (120px / 4));
    }
    &__tech {
      overflow-x: scroll;

      &-scroll {
        display: block;
      }
    }
  }
}

@media (max-width: 992px) {
	.models {
    &__item {
      width: calc(100% / 2 - (120px / 4));
    }
	}
}

@media (max-width: 767px) {
	.models {
    &__list,
    &__item {
      margin-left: 0;
      margin-right: 0;
    }
    &__list {
      align-items: center;
      flex-direction: column;
    }
    &__item {
      width: 100%;
      max-width: 350px;
      margin-left: 0;
      margin-right: 0;
    }
	}
}

sources.components/input/input.scss:
.input {
    padding: 17px 0px 17px 23px;
    position: relative;
    display: block;
    border-radius: 4px;
    border: 1px solid $border;
    background-color: $white;
    transition: border-color 0.3s;
    cursor: text;
    &:hover {
        border-color: $active;
    }
    &.--textarea {
        max-height: 120px;
        height: 100%;
        margin-bottom: 25px;
        & .input__element {
            height: 100%;
            font-family: $roboto;
            font-size: 16px;
        }
    }
    &__file {
        position: relative;
        display: block;
        width: 100%;
        cursor: pointer;
        @media (min-width: 1600px) {
            margin-left: 20px;
        }
        & input {
            position: absolute;
            width: 0;
            height: 0;
            opacity: 0;
        }
        &-el {
            display: inline-block;
            vertical-align: middle;
            & + & {
                margin-left: 5px;
            }
        }
        &-icon {
            width: 20px;
            height: 20px;
            // background: url('./images/icon-clip.svg') 50% 50% no-repeat;
        }
        &-text {
            line-height: 1.2;
        }
        &-count {
            display: block;
            margin-top: 10px;
            width: 100%;
            color: $grey;
            font-size: 13px;
            transition: color 0.3s;
            &.--error {
                color: $error;
            }
        }
        &-start {
            display: flex;
            align-items: center;
        }
        &-end {
        }
    }
    &.--hasError {
        border-color: $error !important;
        & .input__error-msg {
            opacity: 1;
        }
        & .input__placeholder {
            opacity: 0;
        }
    }
    &.--focused,
    &.--hasValue {
        & .input__element {
            opacity: 1;
        }
        & .input__error-msg,
        & .input__placeholder {
            transform: translateY(-15px);
            font-size: 12px;
        }
    }
    &__element {
        word-wrap: break-word;
        font-size: 15px;
        font-weight: 400;
        letter-spacing: 0;
        color: #333;

        width: 100%;
        resize: none;
        opacity: 0;
        transition: opacity 0.3s;
        &:focus {
            opacity: 1;
        }

        &::selection {
            background: #7f859836;
        }
    }
    &__placeholder,
    &__error-msg {
        top: 16px;
        font-size: 15px;

        position: absolute;
        // top: 19px;
        left: 24px;
        will-change: transform;
        transition: font-size 0.3s, transform 0.3s, opacity 0.3s;
    }
    &__placeholder {
        color: $formPlaceholder;
    }
    &__error-msg {
        opacity: 0;
        color: $error;
    }
}

@media (max-width: 1200px) {
    .input {
        &.--textarea {
            min-height: 120px;
        }
    }
}
@media (max-width: 767px) {
    .input {
        padding-top: 9px;
        padding-bottom: 9px;
        &__error-msg,
        &__placeholder {
            top: 12px;
            font-size: 12px;
        }
        &__file {
            &-text {
                font-size: 14px;
            }
            &-count {
                bottom: -1px;
            }
        }
        &.--focused,
        &.--hasValue {
            & .input__error-msg,
            & .input__placeholder {
                opacity: 0;
                transform: none;
            }
        }
    }
}
@media (max-width: 450px) {
    .input {
        &.--textarea {
            min-height: 100px;
        }
    }
}

sources.components/popup/popup.scss:
/* popup start */

.popup {
    position: fixed;
    z-index: 10;
    top: 0;
    left: 0;
    background: rgba(0, 0, 0, 0.7);
    width: 100%;
    height: 100%;
    overflow: auto;
    pointer-events: none;
    opacity: 0;
    visibility: hidden;
    transition: $transition;

    &.is-active {
        pointer-events: auto;
        opacity: 1;
        visibility: visible;
    }

    &__header {
        &-tel {
            font-size: 18px !important;
            font-weight: normal !important;
        }
        &-middle {
            margin: 0px 0 70px;
            @media (max-width: $phone) {
                flex-direction: column;
            }
            &-info {
                display: block !important;
            }
        }
        &-logo {
            display: block !important;
            &-text {
                display: block !important;
            }
            &-line {
                display: block !important;
                @media (max-width: $phone) {
                    transform: rotate(90deg);
                }
            }
        }
    }
}

.popup__wrapper {
    display: table;
    height: 100%;
    width: 100%;
}

.popup__inner {
    display: table-cell;
    vertical-align: middle;
    padding: 50px 0;
}

.popup__content {
    background: #fff;
    padding: 70px 20px;
    max-width: 730px;
    margin: 0 auto;
    position: relative;
    border-radius: 20px;
}

.popup__content--fluid {
    padding-left: 0;
    padding-right: 0;
}

.popup__content--centered {
    display: flex;
    flex-direction: column;
    align-items: center;
}

.popup__btn-close {
    position: absolute;
    top: 20px;
    right: 20px;
}

.popup__title {
    margin-bottom: 20px;
}

.popup__subtitle {
    margin: 0;
    text-align: center;
    font-size: 24px;
}

.popup__subtitle--order {
    max-width: 360px;
    margin: 0 auto 40px;
}

.popup__mobile-menu,
.popup__phone {
    margin-bottom: 30px;
}

.popup__link {
    text-decoration: none;
    color: inherit;
    white-space: nowrap;
}

@media (max-width: 767px) {
    .popup__inner {
        padding: 0;
    }

    .popup__content {
        max-width: 100%;
        min-height: 100vh;
        border-radius: 0;
        padding-top: 100px;
    }

    .popup__subtitle {
        font-size: 18px;
    }

    .popup__subtitle--order {
        max-width: 260px;
    }
}

/* popup end */

