                transform: translateY(-50%) rotate3d(0, 0, 1, -45deg);
            }
            & .form__select-list {
                opacity: 1;
                transform: none;
                pointer-events: unset;
                max-width: 375px;
                border-radius: 0px 0px 7px 6px;

                max-height: 247px;
                // overflow: hidden;
                // overflow-y: hidden;
                // overflow-y: scroll;
            }
        }
        &.--selected {
            border-color: $border_inputV;
            background-color: transparent;
            & .form__select-head {
                color: $black;
                border-color: $border_inputV;
                background-color: transparent;
            }
        }
        &-input {
            position: relative;
            margin-bottom: 20px;
        }
        &-head {
            display: block;
            position: relative;

            text-align: center;
            width: 110px;
            max-width: 100%;
            padding: 7px 25px 7px 10px;
            border: 1px solid #e0e0e7;
            border-radius: 6px;
            cursor: pointer;
            color: #1ba4d9;

            transition: border-color $transition, background-color $transition;
            cursor: pointer;
            &:after {
                // Arrow
                content: "";
                display: block;
                width: 7px;
                height: 7px;
                position: absolute;
                top: 50%;
                right: -10px;
                margin-right: 20px;
                border-top: 1px solid $border_arrow;
                border-right: 1px solid $border_arrow;
                transform: translateY(-50%) rotate3d(0, 0, 1, 135deg);
                transition: transform $transition;
                will-change: transform;
            }
            &::before {
                // Custom overflow
                content: "";
                display: block;
                width: 22px;
                height: 14px;
                position: absolute;
                background-color: white;
                top: 36%;
                right: 1px;
            }
        }
        &-list {
            position: absolute;
            width: 100%;
            max-width: 100%;
            font-size: 14px;
            line-height: 18px;
            color: $text_black;
            border: 1px solid $bg_gray;
            border-radius: 2px;
            background-color: #fff;
            opacity: 0;
            transform: translate3d(0, 20px, 0);
            transition: transform $transition, opacity $transition;
            box-shadow: $shadow;
            will-change: opacity, transform;
            pointer-events: none;
            cursor: pointer;
            z-index: 11;
            overflow: hidden;
            overflow-y: scroll;
        }
        &-item {
            margin-top: 0px !important;
            padding: 12px;
            text-align: center;
            font-size: 15px;
            border-top: 1px solid $bg_gray;
            transition: background-color $transition;
            &:hover {
                background-color: $bg_gray;
            }
            &::after {
                display: none !important;
            }
        }
        &-btns {
            display: flex;
            justify-content: space-between;
        }
    }
}

